import React from "react";
import "./about.css";
import Avatar from "../../assets/kevinZavatar-2.svg";

const About = () => {
  return (
    <section className="about container section" id="about">
      <h2 className="section__title">About Me</h2>
      <div className="about__container grid">
        <img src={Avatar} alt="" className="about__img" />
        <div className="about_data grid">
          <div className="about_info">
            <p className="about_description">
              I am Kevin Zhang
              Innovative full-stack developer, excelling in React/React
              Native-based solutions with a knack for efficient data handling
              and creating impactful, user-centric applications. Fun fact: Spent
              6 years mastering mechanical engineering.
            </p>
            <a href="" className="btn">Download CV</a>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
